import { Routes, Route } from "react-router-dom";
import './App.css';
import Login from './Login.js';
import Profile from './Profile.js';

function App() {
    return (
        <div>
            <Routes>
                <Route path="/" element={<Login />} />
                <Route path="profile" element={<Profile />} />
            </Routes>
        </div>
    );
}

export default App;
